DROP TABLE IF EXISTS `TransportRotation`; 
CREATE TABLE `TransportRotation` ( `ID` INT NOT NULL DEFAULT '0', `GameObjectsID` INT NOT NULL DEFAULT '0', `TimeIndex` INT NOT NULL DEFAULT '0', `RotX` FLOAT NOT NULL DEFAULT '0', `RotY` FLOAT NOT NULL DEFAULT '0', `RotZ` FLOAT NOT NULL DEFAULT '0', `RotW` FLOAT NOT NULL DEFAULT '0', PRIMARY KEY (`ID`)) ENGINE=InnoDB DEFAULT CHARSET=utf8; 
